export default function DealCard({deal}) {
    return (
        <div className="max-w-sm rounded overflow-hidden shadow-lg m-4">
          <div className="px-6 py-4">
            <div className="font-bold text-xl mb-2">
                Сделка по продукту {deal.bet.product.product_name}
            </div>
            <p className="text-gray-700 text-base">
              Стоимость товара по сделке: {deal.bet.price} BYN
            </p>
          </div>
          <div className="px-6 pt-4 pb-2">
            <span className={`inline-block rounded-full px-3 py-1 text-sm font-semibold text-white mr-2`}>
              {deal.deal_status.status_description}
            </span>
          </div>
        </div>
    );
}
